import React from 'react';
import { Link } from 'react-router-dom';

function SmallMenu({ name }) {
  return (
    <li>
      {name === '음식 종류벌' && <Link to="/mapfoodtype">음식 종류별</Link>}
      {name === '지역별' && <Link to="/mapfoodsh">지역별</Link>}
    </li>
  );
}

export default SmallMenu;
